import Favorite from './Favorite';
import Transaction from './Transation';

export default function MainPageRoot() {    
    return(
        <div className='d-flex align-items-start flex-column bd-highlight mb-3'>        
        <CarouselItem/>
        <Favorite/>
        <TransactionItem/>
        </div>
    )
}
